import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Row>
        <Col className="bg-dark" md={8}>
          <h4>Chazzy</h4>
        </Col>
        <Col className="bg-light" md={2}>
          <h4>Chazzy</h4>
        </Col>
      </Row>
    </div>
  );
}

export default App;
